const mongoose=require('mongoose')
const md5=require('../util/md5')

const userSchema = new mongoose.Schema({
    username: {
        type:String,
        required:true
    },
    password:{
        type:String,
        required:true,
        set:value=>md5(value)
    },
    privatepsd:{
        type:String,
        default:''
    },
    email:{
        type:String,
        default:''

    },
    img:{
        type:String,
        default:"data:image/jpg;base64,"
    }
  });

  module.exports=userSchema